import React from 'react';
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";

import { connect } from 'react-redux'
import {Switch, Route, withRouter,Redirect} from 'react-router-dom';

// ACTIONS
import {removeError} from '../store/actions/errors'
import { authUser } from '../store/actions/auth';

// COMPONENTS
// import Homepage from '../components/Homepage';
import HomeMain from './Home/HomeMain';
import PatientsMain from "./Patients/PatientsMain";

//Para que todas las Routes entren en el grid.
const styles = theme => ({
toolbar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-middle",
    padding: "0 8px",
    ...theme.mixins.toolbar
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing.unit * 3
  },
  })

const Dashboard = props => {
  const { classes, theme } = props;
  const { authUser, errors, removeError, currentUser } = props;
  console.log(currentUser);

  return (
      <main className={classes.content}>
        <div className={classes.toolbar}/>
        <Switch>
          <Route 
            exact 
            path="/" 
            render={props => ( <Redirect to='/home'/> )}
          />
          <Route 
            exact 
            path="/home" 
            render={props => {
              return (
                <HomeMain headerTitle={"Inicio"} />
              );
            }}
          />
          <Route 
            exact 
            path="/pacientes" 
            render={props => {
              return(
                <PatientsMain headerTitle={"Pacientes"}  />
              );
            }}
          />
          <Route 
            exact 
            path="/agenda" 
            render={props => {
              return(
                <div>Agenda</div>
              );
            }}
          />
          <Route 
            exact 
            path="/dietas" 
            render={props => {
              return(
                <div>Planes alimenticios</div>
              );
            }}
          />
          <Route 
            exact 
            path="/recetas" 
            render={props => {
              return(
                <div>Recetas</div>
              );
            }}
          />
          <Route 
            exact 
            path="/estadisticas" 
            render={props => {
              return(
                <div>Estad√≠sticas</div>
              );
            }}
          />
        </Switch>
      </main>

    )
}

function mapStateToProps(state) {
  return {
    currentUser: state.currentUser,
    errors: state.errors
  }
}

Dashboard.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired
};

export default withRouter(connect(mapStateToProps,{ authUser, removeError })(withStyles(styles, {withTheme: true})(Dashboard)))
